(1, 3, 'Lomba Gerak Jalan Menggunakan Baju Adat', 'lomba-gerak-jalan-menggunakan-baju-adat', '231117064411.jpg', NULL, 'Dalam rangka meriahkan Hari Pramuka ke-62, Hari Jadi Kabupaten Bekasi ke-73 dan HUT Kemerdekaan RI ke-78. Pemerintah Kabupaten Bekasi mengadakan lomba gerak jalan menggunakan pakaian adat dan senam se...', '<p align=\"justify\">Dalam rangka meriahkan Hari Pramuka ke-62, Hari Jadi Kabupaten Bekasi ke-73 dan HUT Kemerdekaan RI ke-78. Pemerintah Kabupaten Bekasi mengadakan lomba gerak jalan menggunakan pakaian adat dan senam sehat. Sekitar 1500 peserta yang mengikuti acara tersebut, yang terdiri dari 76 grup gerak jalan dan 116 grup senam sehat. Yang masing-masing grup terdiri dari 10 peserta setiap desa, instansi, tokoh masyarakat, pelajar, mahasiswa, Puskesmas, guru dan unsur lainnya.</p>\r\n<p align=\"justify\">Menurut Najmuddin Camat Tambun Utara, untuk rute pada kegiatan gerak jalan kali ini, yang dilakukan start dari Kantor Kecamatan Tambun Utara dan Finish di Water Splash Waterpark Darmawangsa Tambun Utara dengan jarak tempuh kurang lebih 3 kilometer.</p>\r\n<p align=\"justify\">SMP Negeri 1 Tambun Utara juga tidak lupa mengikuti kegiatan gera jalan tingkat kecamatan, dengan mengirimkan perwakilan untuk mengikuti kegiatan tersebut</p>', '2023-11-18 10:37:58', '2023-08-16 20:28:40', '2023-11-17 11:44:11'),
(2, 2, 'Peringatan Hari Pramuka Tingkat Sekolah', 'peringatan-hari-pramuka-tingkat-sekolah', '231117064652.jpg', NULL, 'Dalam rangka memperingati hari pramuka ke-62, pasuskatama ekstrakurikuler pramuka SMP Negeri 1 Tambun Utara mengadakan apel atau upacara sekaligus memberikan penghargaan kepada pasuskatama', '<p align=\"justify\">Dalam rangka memperingati hari pramuka ke-62, pasuskatama ekstrakurikuler pramuka SMP Negeri 1 Tambun Utara mengadakan apel atau upacara sekaligus memberikan penghargaan kepada pasuskatama</p>', '2023-11-18 10:37:58', '2023-08-16 20:44:21', '2023-11-17 11:46:52'),
(3, 2, 'Peringatan HUT RI', 'peringatan-hut-ri', '231117065015.jpg', NULL, 'Dalam rangka memperingati HUT RI ke-78, Terus melaju untuk Indonesia Maju. Siswa dan Guru SMP Negeri 1 Tambun Utara mengadakan kegiatan Lomba 17 Agustus 2023, yang dimeriahkan dengan berbagai macam lo...', '<p align=\"justify\">Dalam rangka memperingati HUT RI ke-78, Terus melaju untuk Indonesia Maju. Siswa dan Guru SMP Negeri 1 Tambun Utara mengadakan kegiatan Lomba 17 Agustus 2023, yang dimeriahkan dengan berbagai macam lomba.</p>', '2023-11-18 10:37:58', '2023-08-16 20:54:20', '2023-11-17 11:50:15'),
(4, 2, 'Penyerahan Hadiah Lomba 17 Agustus 2023', 'penyerahan-hadiah-lomba-17-agustus-2023', '231117065308.jpg', NULL, 'Menjelang beberapa hari setelah kegiatan Lomba 17 Agustus 2023, penyerahan hadiah kepada pemenang lomba di setiap cabang lomba, yang diberikan oleh Kepala Sekolah dan Guru.', '<p align=\"justify\">Menjelang beberapa hari setelah kegiatan Lomba 17 Agustus 2023, penyerahan hadiah kepada pemenang lomba di setiap cabang lomba, yang diberikan oleh Kepala Sekolah dan Guru.</p>', '2023-11-18 10:37:58', '2023-08-20 20:58:39', '2023-11-17 11:53:08'),
(5, 3, 'Rapat Orangtua Siswa Kelas 7 2023', 'rapat-orangtua-siswa-kelas-7-2023', '231117064644.jpg', NULL, 'SMP Negeri 1 Tambun Utara mengadakan acara rutin, yakni pertemuan wali murid kelas VII. Pertemuan Wali Murid tersebut dilaksanakan diruang kelas partisi SMP Negeri 1 Tambun Utara. Pertemuan Wali Murid...', '<p align=\"justify\">SMP Negeri 1 Tambun Utara mengadakan acara rutin, yakni pertemuan wali murid kelas VII. Pertemuan Wali Murid tersebut dilaksanakan diruang kelas partisi SMP Negeri 1 Tambun Utara. Pertemuan Wali Murid di awal tahun pelajaran sangat penting untuk dilaksanakan, pertemuan wali murid dilakukan untuk sebuah pembuka jalur komunikasi antara pihak sekolah dan pihak orang tua. Peranan Wali Murid sebagai rekan guru dalam mendidik anak-anak tidak dapat disepelekan. Tujuan dari diadakannya pertemuan ini yaitu, mensosialisasikan program Sekolah, tata tertib siswa, serta perkenalan guru/wali kelas.</p>\r\n<p align=\"justify\">Acara rutin setiap tahun yang dilaksanakan oleh Sekolah ini bertujuan untuk menjembatani antara pihak sekolah dengan para orang tua siswa yang berhubungan dengan kebutuhan peserta didik, diantaranya kebutuhan pokok seperti proses belajar mengajar maupun kebutuhan pendukung lain demi kelancaran proses belajar mengajar.</p>\r\n<p align=\"justify\">Antusiasme dan semangat yang luar biasa dari para wali murid SMP Negeri 1 Tambun Utara dapat dilihat dari jumlah yang datang. Hal ini menunjukkan kepedulian para orang tua/wali murid kepada SMP Negeri 1 Tambun Utara. Dalam pertemuan ini disampaikan beberapa materi yang menyangkut kemajuan dan perkembangan para siswa nantinya.</p>\r\n<p align=\"justify\">Drs. Wanda, M.M.Pd selaku Kepala Sekolah, Bapak H.Idris selaku Komite Sekolah , para Wakil Kepala Sekolah beserta Wali Kelas 7 turut serta mengisi kegiatan pertemuan wali murid dengan menjelaskan beberapa hal seperti :</p>\r\n<ul>\r\n<li>Visi dan Misi Sekolah</li>\r\n<li>Perkenalan Wali Kelas</li>\r\n<li>Program Sekolah</li>\r\n<li>Struktur kurikulum</li>\r\n<li>Beban belajar peserta didik</li>\r\n<li>Penilaian ketuntasan belajar peserta didik</li>\r\n<li>Ketuntasan belajar peserta didik dalam menempuh pendidikan di SMP Negeri 1 Tambun Utara</li>\r\n<li>Syarat kenaikan kelas</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p align=\"justify\">Dengan adanya pemaparan program kurikulum diharapkan orang tua/wali dapat memantau perkembangan dan kemajuan anak-anaknya. Sehingga akan terjalin kerjasama yang baik antara pihak sekolah dan orang tua/ wali. Kalender akademik juga disampaikan supaya orang tua mengetahui jadwal kegiatan apa saja yang akan ditempuh pada kegiatan selama dua semester. Disambung materi Kesiswaan seperti:</p>\r\n<ul>\r\n<li>Tata tertib sekolah</li>\r\n<li>Perilaku disiplin</li>\r\n<li>Tata tertib jam masuk sekolah</li>\r\n<li>Konsekuensi untuk siswa yang melanggar peraturan</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p align=\"justify\">Tidak hanya itu, Kepala Sekolah beserta jajaranya juga menegaskan tentang tata tertib di sekolah maka diharapkan orang tua/wali juga ikut bekerjasama untuk menanamkan kedisiplinan pada diri siswa, selain materi kurikulum dan kesiswaan, materi tentang sarana dan prasarana praktik yang ada di SMP Negeri 1 Tambun Utara tidak lupa di perkenalkan kepada para wali murid.</p>', '2023-11-18 10:37:58', '2023-09-18 02:10:41', '2023-11-17 11:46:44'),
(6, 3, 'Realisasi Pengecatan Lapangan Olahraga', 'realisasi-pengecatan-lapangan-olahraga', '231117064019.jpg', NULL, 'Dalam rangka meningkatkan sarana dan prasana yang ada di SMP Negeri 1 Tambun Utara. SMP Negeri 1 Tambun Utara merealisasikan pengecatan lapangan olahraga yang beberapa saat lalu direncanakan pada saat...', '<p align=\"justify\">Dalam rangka meningkatkan sarana dan prasana yang ada di SMP Negeri 1 Tambun Utara. SMP Negeri 1 Tambun Utara merealisasikan pengecatan lapangan olahraga yang beberapa saat lalu direncanakan pada saat rapat orangtua wali murid.</p>\r\n<p align=\"justify\">Pengecatan dilakukan Mulai dari jam 07.00 WIB sampai dengan selesai. Esok hari setelah lapangan selesai dicat dan kering, lapangan diresmikan oleh Drs. Wanda, M.M.Pd selaku Kepala Sekolah beserta Jajaran Wakil Kepala Sekolah, Guru dan Staff.</p>', '2023-11-18 10:37:58', '2023-09-18 02:54:09', '2023-11-17 11:40:19'),
(7, 1, 'Kegiatan GeRaCa', 'kegiatan-geraca', '231117064629.jpg', NULL, 'GeRaCa singkatan dari Gerak Rabu membaCa merupakan sebuah kegiatan literasi yang dilakukan setiap hari Rabu dilapangan SMP Negeri 1 Tambun Utara, pada pukul 06.50 WIB sebelum memasuki jam pertama pela...', '<p align=\"justify\">GeRaCa singkatan dari Gerak Rabu membaCa merupakan sebuah kegiatan literasi yang dilakukan setiap hari Rabu dilapangan SMP Negeri 1 Tambun Utara, pada pukul 06.50 WIB sebelum memasuki jam pertama pelajaran. Agar kegiatan mudah diawasi oleh guru pendamping, kegiatan ini dilalukan bergiliran per 3 sampai 4 kelas setiap hari Rabu.</p>\r\n<p align=\"justify\">Tidak hanya melakukan kegiatan membaca saja, siswa juga mampu menjelaskan ide cerita ataupun sinopsis buku yang dia baca secara singkat. Lalu siswa tuliskan pada sebuah Sticky Note yang mereka bawa, untuk mereka tempelkan di pohon literasi yang sudah disediakan</p>', '2023-11-18 10:37:58', '2023-09-18 03:44:05', '2023-11-17 11:46:29'),
(8, 1, 'Kegiatan P5 Pembiasaan Shalat Dhuha', 'kegiatan-p5-pembiasaan-shalat-dhuha', '231117063911.jpg', NULL, 'Projek Penguatan Profil Pelajar Pancasila (P5) merupakan salah satu bagian yang tak terpisahkan dalam Implementasi Kurikulum Merdeka (IKM). P5 adalah upaya untuk mewujudkan Pelajar Pancasila yang mamp...', '<p align=\"justify\">Projek Penguatan Profil Pelajar Pancasila (P5) merupakan salah satu bagian yang tak terpisahkan dalam Implementasi Kurikulum Merdeka (IKM). P5 adalah upaya untuk mewujudkan Pelajar Pancasila yang mampu berperilaku sesuai dengan nilai-nilai Pancasila, yaitu beriman dan bertaqwa kepada Tuhan Yang Maha Esa, berkebhinekaan global, gotong royong, mandiri, bernalar kritis, dan kreatif. IKM P5 menjadi istimewa karena penerapannya tidak terintegrasi dalam pembelajaran setiap mata pelajaran melainkan mempunyai porsi khusus dalam setiap alokasi jam mata pelajaran yang membuat peserta didik memiliki kesempatan untuk dapat mengembangkan kompetensi pengetahuan, keterampilan dan sikap mereka dengan belajar dari teman mereka, guru, bahkan sampai pada tokoh masyarakat sekitar dalam menganalisis isu-isu hangat yang terjadi di lingkungan sekitar.</p>\r\n<p align=\"justify\">Kegiatan P5 yang pertama dilaksanakan di SMP Negeri 1 Tambun Utara mengambil tema bangunlah jiwa dan raganya dengan judul Stop Bulying. Mengapa SMP Negeri 1 Tambun Utara melakukan kegiatan P5 yang bertemakan Stop Bulying? dikarenakan di SMP Negeri 1 Tambun Utara masih banyaknya kasus perundungan sesama pelajar baik satu tingkat kelas maupun berbeda tingkat kelas. Upaya untuk mengurangi hal tersebut maka dituangkan dalam kegiatan P5.</p>\r\n<p align=\"justify\">Didalam kegiatan P5 ini nilai nilai Pancasila yang diambil pada dimensi Ketuhanan yang Maha Esa dan berakhlak mulia. Dengan elemen akhlak beragama(akhlak kepada Tuhan yang Maha Esa) dan akhlak terhadap sesama manusia. Adapun salah satu kegiatan P5 yang diimpelementasikan adalah tata cara berwudhu dan shalat dhuha. Kegiatan pembiasaan shalat dhuha merupakan suatu kegiatan mengerjakan sunah Rasulullah saw yaitu shalat dhuha yang dikerjakan secara berulang-ulang dan terus-menerus yang bertujuan agar shalat dhuha menjadi suatu rutinitas yang biasa dilakukan.</p>', '2023-11-18 10:37:58', '2023-09-18 04:05:17', '2023-11-17 11:39:11'),
(9, 1, 'Kegiatan P5 Pembuatan Mural', 'kegiatan-p5-pembuatan-mural', '231117064331.jpg', NULL, 'Projek Penguatan Profil Pelajar Pancasila (P5) merupakan salah satu bagian yang tak terpisahkan dalam Implementasi Kurikulum Merdeka (IKM). P5 adalah upaya untuk mewujudkan Pelajar Pancasila yang mamp...', '<p align=\"justify\">Projek Penguatan Profil Pelajar Pancasila (P5) merupakan salah satu bagian yang tak terpisahkan dalam Implementasi Kurikulum Merdeka (IKM). P5 adalah upaya untuk mewujudkan Pelajar Pancasila yang mampu berperilaku sesuai dengan nilai-nilai Pancasila, yaitu beriman dan bertaqwa kepada Tuhan Yang Maha Esa, berkebhinekaan global, gotong royong, mandiri, bernalar kritis, dan kreatif. IKM P5 menjadi istimewa karena penerapannya tidak terintegrasi dalam pembelajaran setiap mata pelajaran melainkan mempunyai porsi khusus dalam setiap alokasi jam mata pelajaran yang membuat peserta didik memiliki kesempatan untuk dapat mengembangkan kompetensi pengetahuan, keterampilan dan sikap mereka dengan belajar dari teman mereka, guru, bahkan sampai pada tokoh masyarakat sekitar dalam menganalisis isu-isu hangat yang terjadi di lingkungan sekitar.</p>\r\n<p align=\"justify\">Kegiatan P5 yang pertama dilaksanakan di SMP Negeri 1 Tambun Utara mengambil tema bangunlah jiwa dan raganya dengan judul Stop Bulying. Mengapa SMP Negeri 1 Tambun Utara melakukan kegiatan P5 yang bertemakan Stop Bulying? dikarenakan di SMP Negeri 1 Tambun Utara masih banyaknya kasus perundungan sesama pelajar baik satu tingkat kelas maupun berbeda tingkat kelas. Upaya untuk mengurangi hal tersebut maka dituangkan dalam kegiatan P5.</p>\r\n<p align=\"justify\">Didalam kegiatan P5 ini nilai nilai Pancasila yang diambil pada dimensi Ketuhanan yang Maha Esa dan berakhlak mulia. Dengan elemen akhlak beragama (akhlak kepada Tuhan yang Maha Esa) dan akhlak terhadap sesama manusia. Adapun salah satu kegiatan P5 yang diimpelementasikan adalah kegiatan pembuatan mural stop bulying.</p>', '2023-11-18 10:37:58', '2023-09-18 04:30:47', '2023-11-17 11:43:31'),
(10, 1, 'Kegiatan P5 Karakter Building', 'kegiatan-p5-karakter-building', '231118012048.jpg', NULL, 'Projek Penguatan Profil Pelajar Pancasila (P5) merupakan salah satu bagian yang tak terpisahkan dalam Implementasi Kurikulum Merdeka (IKM). P5 adalah upaya untuk mewujudkan Pelajar Pancasila yang mamp...', '<p align=\"justify\">Projek Penguatan Profil Pelajar Pancasila (P5) merupakan salah satu bagian yang tak terpisahkan dalam Implementasi Kurikulum Merdeka (IKM). P5 adalah upaya untuk mewujudkan Pelajar Pancasila yang mampu berperilaku sesuai dengan nilai-nilai Pancasila, yaitu beriman dan bertaqwa kepada Tuhan Yang Maha Esa, berkebhinekaan global, gotong royong, mandiri, bernalar kritis, dan kreatif. IKM P5 menjadi istimewa karena penerapannya tidak terintegrasi dalam pembelajaran setiap mata pelajaran melainkan mempunyai porsi khusus dalam setiap alokasi jam mata pelajaran yang membuat peserta didik memiliki kesempatan untuk dapat mengembangkan kompetensi pengetahuan, keterampilan dan sikap mereka dengan belajar dari teman mereka, guru, bahkan sampai pada tokoh masyarakat sekitar dalam menganalisis isu-isu hangat yang terjadi di lingkungan sekitar.</p>\r\n<p align=\"justify\">Kegiatan P5 yang pertama dilaksanakan di SMP Negeri 1 Tambun Utara mengambil tema bangunlah jiwa dan raganya dengan judul Stop Bulying. Mengapa SMP Negeri 1 Tambun Utara melakukan kegiatan P5 yang bertemakan Stop Bulying? dikarenakan di SMP Negeri 1 Tambun Utara masih banyaknya kasus perundungan sesama pelajar baik satu tingkat kelas maupun berbeda tingkat kelas. Upaya untuk mengurangi hal tersebut maka dituangkan dalam kegiatan P5.</p>\r\n<p align=\"justify\">Didalam kegiatan P5 ini nilai nilai Pancasila yang diambil pada dimensi Ketuhanan yang Maha Esa dan berakhlak mulia. Dengan elemen akhlak beragama(akhlak kepada Tuhan yang Maha Esa) dan akhlak terhadap sesama manusia.</p>\r\n<p align=\"justify\">Adapun salah satu kegiatan P5 yang diimpelementasikan adalah kegiatan karakter building. Ke